import React from 'react';
import mercedes from './Medicines'
import OurCard from './Card'
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
const useStyles = makeStyles(() => ({

    paper: {
        height: 140,
        width: 100,
    },

}));
export default function Mercedes(props) {

    const [product, setProduct] = useState({})

    const dataChange = (item) => {
      setProduct({product: item ,onChange:dataChange})
    }
    useEffect(()=>{
      dataChange()
    },[])
    
    const classes = useStyles();
    return (
        <div>
            <Grid container justify="center">
                {props.ndata.map((value) => (
                    <Grid key={value} >
                        <OurCard className={classes.paper} value={value} />
                    </Grid>
                ))}
            </Grid>
        </div>

    )
}
